    const [char1, setChar1] = useState("character1")
    const [char2, setChar2] = useState("character2")
    return(
    <div className="characters">
        <div className={char1}><div className='charimg1' onMouseOver={setActive1}></div><div className='char1disc'></div></div>
        <div className={char2}><div className='char2disc'></div><div className='charimg2' onMouseOver={setActive2}></div></div>
    </div>)
}
export default Characters
